const lengthOfLongestSubstringKDistinct = (s, k) => {

    if (!s) {
        return 0;
    }
    if (s.length < 2) {
        return k === 0 ? 0 : 1;
    }
    if (!k) {
        return 0;
    }

    //let list = [];
    let fast = 1;
    let slow = 0;
    let left = 0;
    let right = s.length;
    //let len = s.length;


    let map = {};
    let max = 0;


    let direction = 0;
    //0 fast go right
    //1 slow go right
    //2 slow go left
    //3 fast go left
    let temp;
    let key;

    while (left <= right - 1 && fast >= slow && slow >= left) {
        //let str = s.slice(slow, fast);
        // console.log(str || 'EMPTY');
        //console.log(str + ' - ' + direction + ' left - ' + left + ' right - ' + right + ' slow - ' + slow + ' fast - ' + fast);

        temp = fast - slow;
        if (direction === 0) {
            if (slow === fast) {
                // console.log('Removing - ' + s[fast - 1]);
                key = s[fast - 1];
                if (map[key] > 1) {
                    map[key]--;
                } else {
                    delete map[key];
                }
            } else {
                // console.log('Adding - ' + s[fast - 1]);
                key = s[fast - 1]
                map[key] = key in map ? map[key] + 1 : 1;
            }
            fast++;
        }
        if (direction === 1) {
            if (slow === left) {
                // console.log('Adding - ' + s[fast - 1]);
                key = s[fast - 1];
                map[key] = key in map ? map[key] + 1 : 1;
            } else {
                // console.log('Removing - ' + s[slow - 1]);
                key = s[slow - 1];
                if (map[key] > 1) {
                    map[key]--;
                } else {
                    delete map[key];
                }

            }
            slow++;
        }
        if (direction === 2) {
            if (slow === right) {
                // console.log('Removing - ' + s[slow]);
                key = s[slow];
                if (map[key] > 1) {
                    map[key]--;
                } else {
                    delete map[key];
                }
            } else {
                // console.log('Adding - ' + s[slow]);
                key = s[slow];
                map[key] = key in map ? map[key] + 1 : 1;

            }
            slow--;
        }
        if (direction === 3) {
            // console.log('Removing - ' + s[fast]);
            key = s[fast];
            if (map[key] > 1) {
                map[key]--;
            } else {
                delete map[key];
            }
            fast--;
        }
        // console.log(map);

        if (Object.keys(map).length <= k) {
            max = temp > max ? temp : max;
        }

        if (direction === 0 && fast === right) {
            //fast hit right
            //console.log('Adding - ' + s[fast - 1]);
            direction = 1;
            continue;
        }
        if (direction === 1 && slow === fast) {
            //slow hit fast
            //console.log(str + ' AT TO 2');
            //console.log(str + ' - ' + direction + ' left - ' + left + ' right - ' + right + ' slow - ' + slow + ' fast - ' + fast);
            direction = 2;
            slow--;
            fast--;
            right--;
            continue;
        }
        if (direction === 2 && slow === left) {
            //slow hit left
            direction = 3;
            fast--;
            slow++;
            left++;
            continue;
        }
        if (direction === 3 && slow === fast) {
            //fast hit left
            direction = 0;
            left++;
            slow++;
            fast++;
            continue;
        }
    }
    return max;
};

const betterSolution = (s, k) => {
    if (k === 0 || !s || s.length === 0) return 0;
    if (s.length < k) return s.length;
    let map = {};
    let maxLen = k;
    let left = 0;
    for (let i = 0; i < s.length; i++) {
        let c = s[i];
        map[c] = c in map ? map[c] + 1 : 1;
        if (Object.keys(map).length > k) {
            maxLen = Math.max(maxLen, i - left);
            while (Object.keys(map).length > k) {
                let fc = s[left];
                if (map[fc] === 1) {
                    delete map[fc];
                } else {
                    map[fc]--;
                }
                left++;
            }
        }
    }
    maxLen = Math.max(maxLen, s.length - left);
    return maxLen;
};

const thirdTry = (s, k) => {
    if (k === 0 || !s || s.length === 0) return 0;
    if (s.length < k) return s.length;
    let map = {};
    let max = 0;
    let slow = 0;
    let fast = 0;
    let key;
    while (fast < s.length) {
        key = s[fast];
        map[key] = key in map ? map[key] + 1 : 1;

        if (Object.keys(map).length > k) {
            max = (fast - slow) > max ? (fast - slow) : max;
            while (Object.keys(map).length > k) {
                key = s[slow];
                if (map[key] > 1) {
                    map[key]--;
                } else {
                    delete map[key];
                }
                slow++;
            }
        }
        fast++;
    }
    max = (s.length - slow) > max ? (s.length - slow) : max;
    return max;
};

